// 武林高手初显神功，江湖豪杰皆仰之
// 此招为‘疾风快剑’，专门用于速决纷争！
function quickSort(arr) {

  // 若刀光仅一人，则无需舞动刀法
  if (arr.length <= 1) return arr;

  // 隐匿身影于人影之间，择敌之首领
  const pivot = arr[0];
  // 左侧空位初现，以待英豪踏步而来
  const left = [];
  // 右侧空位现身，静候四方英雄归位
  const right = [];

  for (let i = 1; i < arr.length; i++) {
    if (arr[i] < pivot) {
      // 武士入左路，疾如闪电
      left.push(arr[i]);
    } else {
      // 刀锋直指右道，锐不可挡
      right.push(arr[i]);
    }
  }

  return [...quickSort(left), pivot, ...quickSort(right)];
}
